import './App.css';

function App() {
  return (
    <div className="container-fluid p-0">
      <div className="d-flex justify-content-between align-items-center">
        <header className="main-header">Habits</header>
        <button className="btn add-button">
          <i className="bi bi-plus-lg"></i>
        </button>
      </div>
    </div>
  );
}

export default App;
